  false,\n\t\"url\": null,\n\t\"notes\": \"The Stillwater National Wildlife Refuge
  (Stillwater NWR) and Stillwater Wildlife Management Area (Stillwater WMA) are located
  in western Nevada within Churchill County, approximately 70 miles east of Reno.
  Wetlands in the Lahontan Valley fluctuate depending on yearly water conditions and
  competition for the water resources. During the recent eight year drought period
  from 1987-1994, the few hundred remaining wetland acres evaporated to dry marshes
  by the fall of 1992. Fortunately, on the upswing of the water cycle, a large snow
  pack in the Sierra Nevada during the winter of 1994-1995 and subsequent spring runoff,
  resulted in a considerable increase in wetland acreage in the Lahontan Valley. Peak
  wetland acres for Stillwater NWR and Carson Sink were approximately 11,500 and 90,000
  acres, respectively, reached in mid-July, 1995. The preliminary work has begun on
  a CCP for Stillwater National Wildlife Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
